import { useState } from "react";
import { View, StyleSheet, Pressable } from "react-native";
import { TextInput, Text } from "./Themed";
import { AntDesign } from "@expo/vector-icons";
import { getColors } from "../../constants/Colors";

export default function SearchChat({ navigation, visibility }) {
  const colors = getColors();

  console.log(visibility);


  return (
    <View style={[styles.container, {opacity: visibility ? 0 : 1}]}>
      <View style={[styles.inputContainer, {backgroundColor: colors.defaultColors.card}]}>
        <Pressable
          style={({ pressed }) => [{ opacity: pressed ? 0.5 : 1 }]}
          onPress={() => navigation.navigate("Root")}
        >
          <AntDesign name="arrowleft" size={25} color={colors.tint} />
        </Pressable>
      </View>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    position: "absolute",
    flex: 1,
  },
  inputContainer: {
    height: 40,
  },

});
